export default function Project(props) {
    return (
        <div class="w-1/3 h-80 bg-[#272b33] rounded-md">
            <img class="h-2/3 rounded-tr-md rounded-tl-md w-full" src={props.img}/>
            <h2 class="font-bold text-2xl">Project 1</h2>
        </div>
    );
}
